    "atlantic-coastal-vulnerability-to-sea-level-rise-a-preliminary-database-for-the-u-s-atlantic-c",nt"isopen":
    false,nt"url": null,nt"notes": "The goal of this project is to provide
    a preliminary overview, at a National scale, the relative susceptibility of the
    Nation's coast to sea-level rise through the use of a coastal vulnerability index
    (CVI). This initial classification is based upon the variables geomorphology, regional
    coastal slope, tide range, wave height, relative sea-level rise and shoreline erosion
    and accretion rates. The combination of these variables and the association of these
    variables to each other furnish a broad overview of regions where physical changes
    are likely to occur due to sea-level rise.",nt"license_title": null,nt"extras":
